import React from 'react';
import { Link } from 'react-router-dom';
import SearchBar from './SearchBar';

const Home = () => {
  return (
    <div>
      <h1>Welcome to Rental Apartments</h1>
      <SearchBar />
      <Link to="/search">View All Apartments</Link>
    </div>
  );
};

export default Home;
